const Board = ({ board }) => {
  console.log("board", board);

  const boardStyles = {
    gridTemplateRows: `repeat(${board.size.rows}, 1fr)`,
    gridTemplateColumns: `repeat(${board.size.columns}, 1fr)`,
  };

  return ( 
    <div className="Board" style={boardStyles}>
        {board.rows.map}
    </div>
  )
};

export default Board;
